/**
 * Artist-Friendly Metallic Fresnel by Ole Gulbrandsen
*/
float n_min(float r)
{ 
   return (1-r)/(1+r);
}

float n_max(float r)
{
return (1+sqrt(r))/(1-sqrt(r)); 
}

float get_n(float r,float g)
{
   return n_min(r)*g + (1-g)*n_max(r);
}

float get_k2(float r, float n)
{
   float nr = (n+1)*(n+1)*r-(n-1)*(n-1);
   return nr/(1-r ); 
}
float get_r(float n, float k)
{
   return ((n-1)*(n-1)+k*k)/((n+1)*(n+1)+k*k);
}

float get_g(float n, float k)
{
   float r = get_r(n,k);
   return (n_max(r)-n)/(n_max(r)-n_min(r)); 
}

float olefresnel(float r, float g, float c)
{ 
   // clamp parameters
   float _r = clamp(r, 0.0f, 0.99f); 
   // compute n and k
   float n = get_n(_r,g);
   float k2 = get_k2(_r,n);
   float rs_num = n*n + k2 - 2*n*c + c*c; 
   float rs_den = n*n + k2 + 2*n*c + c*c;
   float rs = rs_num/rs_den;
   float rp_num = (n*n + k2)*c*c - 2*n*c + 1; 
   float rp_den = (n*n + k2)*c*c + 2*n*c + 1;
   float rp = rp_num / rp_den ;
   return 0.5*( rs+rp ); 
}

AtRGB FresnelConductor::kr(float cos_theta)
{
	AtRGB result = AiColor(
      olefresnel(_r.r, _g.r, cos_theta),
      olefresnel(_r.g, _g.g, cos_theta),
      olefresnel(_r.b, _g.b, cos_theta)
   );
	return result;
}



void FresnelConductor::setMaterial(int material, const AtRGB& r, const AtRGB& g)
{
	switch (material)
	{
	case kAluminium:
		_r = Al_r;
      _g = Al_g;
		break;
	case kChrome:
		_r = Cr_r;
      _g = Cr_g;
		break;
	case kCopper:
		_r = Cu_r; 
      _g = Cu_g;
		break;
	case kGold:
		_r = Au_r; 
      _g = Au_g;
		break;
	case kSilver:
		_r = Ag_r; 
      _g = Ag_g;
		break;
	case kPlatinum:
		_r = Pt_r; 
      _g = Pt_g;
		break;
	case kTitanium:
		_r = Ti_r;
      _g = Ti_g;
		break;
	case kTungsten:
		_r = W_r;
      _g = W_g;
		break;
	default:
		_r = r;
      _g = g;
		break;
	}
}